import React from "react";
import "./AddNewExpensesButton.css";
const AddExpensesButton =() =>{



return(
    <>
    
    <button 
    onClick={console.log("click")}
    type="submit"
    className="new-expenses"> 
    Add New Expenses
    </button>
    
    </>
)

}
export default AddExpensesButton;
